import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel4(props) {

    return(
        <div style = {{display: 'flex', flexDirection: 'column'}}>
              <div style = {{display:'flex',flexDirection:'row-reverse',marginRight:'55px'}}>
              <FlipCard
                  width = {"25em"}
                  height = {"20em"}
                  FlipStyle = {{backgroundImage:'url("/webDev.jpg")',
                  backgroundSize:'100%',
                  backgroundRepeat: 'no-repeat',
                  backgroundPosition: 'center'
                }}
                  Back = {
                    <div>
                      <Doughnut 
                      // data={props.webDevChartData.webDevChartData}
                        // options= {props.webDevChartData.options}
                      />
                    </div>
                      }
                >
                </FlipCard>
                    <Road 
                      width={'10em'}
                      height= {'10em'}
                      StylingInfo = {'horizontal-road1'}
                      dashType = 'horizontal-dash'
                    />
                    <Road 
                      width={'10em'}
                      height={'10em'}
                      StylingInfo = {'horizontal-road3'}
                      dashType = {'horizontal-dashC2'}
                    />
                    </div>
                    <div style = {{marginLeft:'25px',marginTop:'-50px'}}>
                    <Road 
                    width={'10em'}
                    height={'10em'}
                    StylingInfo = {'vertical-road2'}
                    dashType = {'vertical-dash'}
                      />
                      <Road 
                    width={'10em'}
                    height={'5em'}
                    StylingInfo = {'vertical-road'}
                    dashType = {'vertical-dash'}
                      />
                    </div>  
                   
                    <FlipCard
                    width = {"25em"}
                    height = {"24em"}
                    FlipStyle = {{
                                    backgroundImage:'url("/devops.jpg")', 
                                    backgroundRepeat: 'no-repeat',
                                    backgroundPosition: 'center'
                                }}
                    // Front=
                    // {
                    //   <div>
                    //     <h1 className = 'devOps-hF'>
                    //     {props.devOpsChartData.frontTitle}
                    //     </h1>
                    //   </div>
                    // }
                    Back = {
                      <div>
                        <Doughnut data={props.devOpsChartData}
                          options= {props.devOpsChartData.options}
                        />
                      </div>
                        }
                  >
                  </FlipCard>

        </div>


    )


}

export default RoadLevel4;
